Опимание товара:
Строительно-отделочный материал для облицовки стен, устройства перегородок, подвесных потолков, огнезащитных покрытий и конструкций.

КНАУФ-лист огнестойкий (ГСП-DF) представляет собой прямоугольный материал, который состоит из двух слоев специального картона с прослойкой из гипсового теста с армирующими добавками, боковые кромки зафальцовываются краями картона (лицевого слоя). Для формирования сердечника применяется гипсовое вяжущее марки Г4 по ГОСТ 125-79.

КНАУФ-листы огнестойкие (ГСП-DF) выпускаются в соответствии ГОСТ 32614-2012 (EN 520:2009).

КНАУФ-листы огнестойкие (ГСП-DF) оснащены с полукруглой утоненной кромкой (ПЛУК), которая обеспечивает создание надежного и плотного стыка. По согласованию производителя с потребителем возможно изготовление листов с другими видами кромок.

Важный компонент КНАУФ-листа огнестойкого (ГСП-DF) – облицовочный картон, сцепление которого с сердечником обеспечивается за счет применения клеящих добавок. Картон выполняет функцию армирующего каркаса и основы под отделочные материалы для нанесения любого отделочного материала (штукатурка, обои, краска, керамическая плитка и др.). По физическим и гигиеническим свойствам картон идеально подходит для применения в жилых помещениях.
Применение
КНАУФ-лист огнестойкий (ГСП-DF) применяется для устройства легких межкомнатных перегородок, подвесных потолков, облицовки стен и огнезащиты конструкций в зданиях и помещениях с сухим и нормальным влажностными режимами по СНиП 23-02-2003.

Порядок основных монтажных работ:

разметка проектного положения конструкции из КНАУФ-листов огнестойких (ГСП-DF);
установка каркаса из КНАУФ-профиля для крепления КНАУФ-листов огнестойких (ГСП-DF);
монтаж и закрепление КНАУФ-листов огнестойких (ГСП-DF) на каркасе;
заделка швов между КНАУФ-листами огнестойкими (ГСП-DF) и углублений от винтов шпаклевкой КНАУФ-Фуген;
грунтование поверхности под отделочные покрытия.
Рекомендации

Монтаж следует выполнять период проведения отделочных работ (в зимнее время при подключенном отоплении) до устройства чистых полов, когда все «мокрые» процессы закончены и выполнены разводки электротехнических и сантехнических систем, в условиях сухого и нормального влажностного режима согласно СНиП 23-02-2003 «Тепловая защита зданий». При этом температура в помещении не должна быть ниже 10°С.
Перед монтажом КНАУФ-листы огнестойкие (ГСП-DF) должны пройти обязательную акклиматизацию (адаптацию) в помещении.
Торцевые кромки КНАУФ-листов огнестойких (ГСП-DF) имеют прямоугольную форму, при устройстве шва с них необходимо снимать фаску (примерно на 1/3 толщины листа).
Преимущества
Изделия обладают повышенной огнестойкостью.
При использовании КНАУФ-листов огнестойких (ГСП-DF) в процессе отделочных работ исключаются «мокрые» процессы.
Увеличивается производительность труда.
Предоставляется возможность реализации неограниченных по замыслу многовариантных архитектурных решений, включая устройство криволинейных поверхностей.
Достигается общая экономия затрат на строительство за счет облегчения конструкции здания.
Обеспечивается не только экологическая чистота, но и благоприятный для человека микроклимат в помещении.
КНАУФ-листы огнестойкие (ГСП-DF) «дышат», регулируют уровень влажности в помещении.
Материал не содержит токсичных компонентов и имеет кислотность, аналогичную кислотности человеческой кожи.
Изделия соответствуют строгим мировым стандартам.
Технические характеристики
Цвет картона на лицевой стороне / на тыльной стороне: розовый/серый;
цвет маркировки: черный;
вид кромки: ПЛУК полукруглая утоненная кромка;
размеры: 2500х1200х12,5 мм;
масса КНАУФ-листа огнестойкого (ГСП-DF) размером 2500х1200х12,5 мм (3 кв.м): 30,6 кг;
упаковка: пакет, 50 листов (150 м2).
Номинальные геометрические размеры КНАУФ-листов:

длина: от 2000 до 4000 мм;
ширина: 600, 1200 мм;
толщина: 12,5; 14; 16 мм.
Пожарно-технические характеристики

КНАУФ-листы огнестойкие (ГСП-DF) относятся к группам:

Г1 (горючесть по ГОСТ 30244);
В2 (воспламеняемость по ГОСТ 30402);
Д1 (дымообразующая способность по ГОСТ 12.1.044);
Т1 (токсичность по ГОСТ 12.1.044).
